INSERT INTO swcampus.curriculums (curriculum_id, category_id, curriculum_name, curriculum_desc) VALUES (121, 20, '게임 최적화 및 상용화 프로젝트', '프로파일링 툴을 활용한 메모리·프레임 최적화 및 마켓(Steam/PlayStore) 빌드·배포') ON CONFLICT DO NOTHING;
INSERT INTO swcampus.curriculums (curriculum_id, category_id, curriculum_name, curriculum_desc) VALUES (122, 21, '블록체인 핵심 이론 및 암호학', '해시 함수, 공개키 암호화(ECC) 등 암호학 기초 및 블록체인의 무결성 원리 이해') ON CONFLICT DO NOTHING;
INSERT INTO swcampus.curriculums (curriculum_id, category_id, curriculum_name, curriculum_desc) VALUES (123, 21, '합의 알고리즘 및 네트워크 구조', 'PoW(작업증명), PoS(지분증명) 등 합의 메커니즘 이해 및 P2P 네트워크 구조 분석') ON CONFLICT DO NOTHING;
INSERT INTO swcampus.curriculums (curriculum_id, category_id, curriculum_name, curriculum_desc) VALUES (124, 21, '이더리움 가상머신(EVM) 및 트랜잭션', 'EVM의 동작 원리, 가스(Gas) 비용 산정 방식, 트랜잭션 수명 주기에 대한 심층 이해') ON CONFLICT DO NOTHING;
INSERT INTO swcampus.curriculums (curriculum_id, category_id, curriculum_name, curriculum_desc) VALUES (125, 21, '지갑 구조 및 노드 운영', '메타마스크 등 지갑의 HD(계층 결정적) 구조 이해 및 Geth 등을 활용한 로컬 노드 구축') ON CONFLICT DO NOTHING;
INSERT INTO swcampus.curriculums (curriculum_id, category_id, curriculum_name, curriculum_desc) VALUES (126, 21, 'Solidity 프로그래밍 기초 및 심화', 'Solidity 문법 숙지 및 상속, 라이브러리, 메모리 관리 등 효율적인 컨트랙트 작성') ON CONFLICT DO NOTHING;
INSERT INTO swcampus.curriculums (curriculum_id, category_id, curriculum_name, curriculum_desc) VALUES (127, 21, '토큰 표준(ERC) 및 탈중앙화 로직', 'ERC-20(토큰), ERC-721(NFT) 등 핵심 표준 구현 및 투표(DAO), 스테이킹 로직 설계') ON CONFLICT DO NOTHING;
