INSERT INTO swcampus.curriculums (curriculum_id, category_id, curriculum_name, curriculum_desc) VALUES (129, 21, 'Web3 라이브러리 및 프론트엔드 연동', 'Ethers.js/Web3.js를 활용한 지갑 연동 및 블록체인 데이터의 프론트엔드(React) 시각화') ON CONFLICT DO NOTHING;
