INSERT INTO swcampus.curriculums (curriculum_id, category_id, curriculum_name, curriculum_desc) VALUES (131, 21, '레이어2(L2) 및 오라클(Oracle) 활용', '확장성 해결을 위한 Polygon/Optimism 네트워크 배포 및 Chainlink를 활용한 오프체인 데이터 연동') ON CONFLICT DO NOTHING;
